import React from 'react';

const FormReducer = (state = [], action) =>{
    console.log(state)  
    switch (action.type) { 
        case 'ADD_DATA': 
            return state.concat([action.user])
        default:
            return state; 
    } 
    
}
 
export default FormReducer
